import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Home from './components/Home/Home.js';
import AboutUs from './components/About/AboutUs.js';
import Products from './components/Products/Products';
import MainNavbar from './components/MainNavbar.js';
import Footer from './components/Footer.js';

/*Supplements*/
import BrainBoosters from './components/Products/Supplements/BrainBoosters.js';
import HeartHealth from './components/Products/Supplements/HeartHealth';
import JointHealth from './components/Products/Supplements/JointHealth';
import LiverTonic from './components/Products/Supplements/LiverTonic';
import NaturalAntiOxidants from './components/Products/Supplements/NaturalAntiOxidants';
import HormonesOralContraceptives from './components/Products/Supplements/HormonesOralContraceptives';
import SlimmingWeightMgmt from './components/Products/Supplements/SlimmingWeightMgmt';
/*Injury*/
import BluntTrauma from './components/Products/Injury/BluntTrauma';
import MuscleRelaxants from './components/Products/Injury/MuscleRelaxants';
import WoundHealing from './components/Products/Injury/WoundHealing';



import './components/style.css';
import './components/navbar.css';
import './components/Home/homepage.css';
import './components/About/about.css';
import './components/Products/product.css';




function App() {
  return (
    <div className="App">

      <Router>
        <MainNavbar/>
        <Routes>
          <Route index element={<Home/>} />
          <Route path="/home" element={<Home/>} />
          <Route path="/about" element={<AboutUs/>} />
          <Route path='/products' element={<Products />}>
              <Route path='brain-boosters-memory-enhancers' element={<BrainBoosters />} />
              <Route path='heart-health' element={<HeartHealth />} />
              <Route path='joint-health' element={<JointHealth />} />
              <Route path='liver-tonic' element={<LiverTonic />} />
              <Route path='natural-antioxidants' element={<NaturalAntiOxidants />} />
              <Route path='hormones-oral-contraceptives' element={<HormonesOralContraceptives />} />
              <Route path='slimming-weight-management' element={<SlimmingWeightMgmt />} />
              <Route path='blunt-trauma' element={<BluntTrauma />} />
              <Route path='muscle-relaxants' element={<MuscleRelaxants />} />
              <Route path='wound-healing' element={<WoundHealing />} />
          </Route>
        </Routes>
        <Footer/>
      </Router>


    </div>
  );
}

export default App;
